import React from 'react';
import './Footer.css';

function Footer() {
    return (
        <footer className="footer">
          <div className="contact">
            <h3>Contact Us</h3>
            <p>123 Main St, Anytown USA</p>
            <p>Phone: 555-555-5555</p>
            <p>Email: info@mywebsite.com</p>
          </div>
        </footer>
      );
}

export default Footer;
